#version 100

uniform 	vec4 hlslcc_mtx4x4unity_ObjectToWorld[4];
uniform 	vec4 hlslcc_mtx4x4unity_WorldToObject[4];
uniform 	vec4 hlslcc_mtx4x4unity_MatrixVP[4];
uniform 	vec4 _BaseMap_ST;
attribute highp vec4 in_POSITION0;
attribute highp vec3 in_NORMAL0;
attribute highp vec4 in_TEXCOORD0;
varying highp vec3 vs_NORMAL0;
varying highp vec4 vs_TEXCOORD0;
varying highp vec4 vs_TEXCOORD1;
vec3 u_xlat0;
vec4 u_xlat1;
float u_xlat6;
void main()
{
    u_xlat0.xyz = in_POSITION0.yyy * hlslcc_mtx4x4unity_ObjectToWorld[1].xyz;
    u_xlat0.xyz = hlslcc_mtx4x4unity_ObjectToWorld[0].xyz * in_POSITION0.xxx + u_xlat0.xyz;
    u_xlat0.xyz = hlslcc_mtx4x4unity_ObjectToWorld[2].xyz * in_POSITION0.zzz + u_xlat0.xyz;
    u_xlat0.xyz = u_xlat0.xyz + hlslcc_mtx4x4unity_ObjectToWorld[3].xyz;
    u_xlat1 = u_xlat0.yyyy * hlslcc_mtx4x4unity_MatrixVP[1];
    u_xlat1 = hlslcc_mtx4x4unity_MatrixVP[0] * u_xlat0.xxxx + u_xlat1;
    u_xlat1 = hlslcc_mtx4x4unity_MatrixVP[2] * u_xlat0.zzzz + u_xlat1;
    vs_TEXCOORD0.xyz = u_xlat0.xyz;
    gl_Position = u_xlat1 + hlslcc_mtx4x4unity_MatrixVP[3];
    u_xlat0.x = dot(in_NORMAL0.xyz, hlslcc_mtx4x4unity_WorldToObject[0].xyz);
    u_xlat0.y = dot(in_NORMAL0.xyz, hlslcc_mtx4x4unity_WorldToObject[1].xyz);
    u_xlat0.z = dot(in_NORMAL0.xyz, hlslcc_mtx4x4unity_WorldToObject[2].xyz);
    u_xlat6 = dot(u_xlat0.xyz, u_xlat0.xyz);
    u_xlat6 = max(u_xlat6, 1.17549435e-38);
    u_xlat6 = inversesqrt(u_xlat6);
    vs_NORMAL0.xyz = vec3(u_xlat6) * u_xlat0.xyz;
    vs_TEXCOORD0.w = 0.0;
    vs_TEXCOORD1.xy = in_TEXCOORD0.xy * _BaseMap_ST.xy + _BaseMap_ST.zw;
    vs_TEXCOORD1.zw = in_TEXCOORD0.xy;
    return;
}


#version 100

#ifdef GL_FRAGMENT_PRECISION_HIGH
    precision highp float;
#else
    precision mediump float;
#endif
precision highp int;
uniform 	vec4 _MainLightPosition;
uniform 	mediump vec4 _MainLightColor;
uniform 	vec3 _WorldSpaceCameraPos;
uniform 	vec4 unity_OrthoParams;
uniform 	mediump vec4 unity_LightData;
uniform 	mediump vec4 unity_SHAr;
uniform 	mediump vec4 unity_SHAg;
uniform 	mediump vec4 unity_SHAb;
uniform 	mediump vec4 unity_SHBr;
uniform 	mediump vec4 unity_SHBg;
uniform 	mediump vec4 unity_SHBb;
uniform 	mediump vec4 unity_SHC;
uniform 	vec4 hlslcc_mtx4x4unity_MatrixV[4];
uniform 	mediump float _RampSmoothing;
uniform 	mediump float _RampThreshold;
uniform 	mediump vec4 _BaseColor;
uniform 	mediump vec4 _SColor;
uniform 	mediump vec4 _HColor;
uniform 	mediump float _IndirectIntensity;
uniform 	mediump float _SingleIndirectColor;
uniform lowp sampler2D _BaseMap;
varying highp vec3 vs_NORMAL0;
varying highp vec4 vs_TEXCOORD0;
varying highp vec4 vs_TEXCOORD1;
#define SV_Target0 gl_FragData[0]
vec4 u_xlat0;
lowp vec4 u_xlat10_0;
mediump vec3 u_xlat16_1;
vec3 u_xlat2;
bvec2 u_xlatb2;
mediump vec4 u_xlat16_3;
mediump vec3 u_xlat16_4;
mediump vec3 u_xlat16_6;
mediump float u_xlat16_11;
float u_xlat15;
bool u_xlatb15;
mediump float u_xlat16_16;
void main()
{
    u_xlat0.x = dot(vs_NORMAL0.xyz, vs_NORMAL0.xyz);
    u_xlat0.x = inversesqrt(u_xlat0.x);
    u_xlat0.xyz = u_xlat0.xxx * vs_NORMAL0.xyz;
    u_xlat15 = ((gl_FrontFacing ? 1 : 0) != 0) ? 1.0 : -1.0;
    u_xlat0.xyz = vec3(u_xlat15) * u_xlat0.xyz;
    u_xlat15 = dot(u_xlat0.xyz, _MainLightPosition.xyz);
    u_xlat16_1.x = u_xlat15 * 0.5 + 0.5;
    u_xlat16_6.x = (-_RampSmoothing) * 0.5 + _RampThreshold;
    u_xlat16_1.x = (-u_xlat16_6.x) + u_xlat16_1.x;
    u_xlat16_11 = _RampSmoothing * 0.5 + _RampThreshold;
    u_xlat16_6.x = (-u_xlat16_6.x) + u_xlat16_11;
    u_xlat16_6.x = float(1.0) / u_xlat16_6.x;
    u_xlat16_1.x = u_xlat16_6.x * u_xlat16_1.x;
    u_xlat16_1.x = clamp(u_xlat16_1.x, 0.0, 1.0);
    u_xlat16_6.x = u_xlat16_1.x * -2.0 + 3.0;
    u_xlat16_1.x = u_xlat16_1.x * u_xlat16_1.x;
    u_xlat16_1.x = u_xlat16_1.x * u_xlat16_6.x;
    u_xlat16_1.x = u_xlat16_1.x * unity_LightData.z;
    u_xlat16_6.xyz = _HColor.xyz * _MainLightColor.xyz + (-_SColor.xyz);
    u_xlat16_1.xyz = u_xlat16_1.xxx * u_xlat16_6.xyz + _SColor.xyz;
    u_xlat2.xyz = (-vs_TEXCOORD0.xyz) + _WorldSpaceCameraPos.xyz;
    u_xlat15 = dot(u_xlat2.xyz, u_xlat2.xyz);
    u_xlat15 = inversesqrt(u_xlat15);
    u_xlat2.xyz = vec3(u_xlat15) * u_xlat2.xyz;
    u_xlatb15 = unity_OrthoParams.w==0.0;
    u_xlat16_3.x = (u_xlatb15) ? u_xlat2.x : hlslcc_mtx4x4unity_MatrixV[0].z;
    u_xlat16_3.y = (u_xlatb15) ? u_xlat2.y : hlslcc_mtx4x4unity_MatrixV[1].z;
    u_xlat16_3.zw = (bool(u_xlatb15)) ? u_xlat2.zz : hlslcc_mtx4x4unity_MatrixV[2].zz;
    u_xlatb2.xy = lessThan(vec4(0.0, 0.0, 0.0, 0.0), vec4(_IndirectIntensity, _SingleIndirectColor, _IndirectIntensity, _IndirectIntensity)).xy;
    u_xlat0 = (u_xlatb2.y) ? u_xlat16_3.xywz : u_xlat0.xyzz;
    u_xlat16_16 = u_xlat0.y * u_xlat0.y;
    u_xlat16_16 = u_xlat0.x * u_xlat0.x + (-u_xlat16_16);
    u_xlat16_3 = u_xlat0.yzwx * u_xlat0.xywz;
    u_xlat16_4.x = dot(unity_SHBr, u_xlat16_3);
    u_xlat16_4.y = dot(unity_SHBg, u_xlat16_3);
    u_xlat16_4.z = dot(unity_SHBb, u_xlat16_3);
    u_xlat16_3.xyz = unity_SHC.xyz * vec3(u_xlat16_16) + u_xlat16_4.xyz;
    u_xlat0.w = 1.0;
    u_xlat16_4.x = dot(unity_SHAr, u_xlat0);
    u_xlat16_4.y = dot(unity_SHAg, u_xlat0);
    u_xlat16_4.z = dot(unity_SHAb, u_xlat0);
    u_xlat16_3.xyz = u_xlat16_3.xyz + u_xlat16_4.xyz;
    u_xlat16_3.xyz = max(u_xlat16_3.xyz, vec3(0.0, 0.0, 0.0));
    u_xlat10_0 = texture2D(_BaseMap, vs_TEXCOORD1.xy);
    u_xlat16_4.xyz = u_xlat10_0.xyz * _BaseColor.xyz;
    SV_Target0.w = u_xlat10_0.w * _BaseColor.w;
    u_xlat16_3.xyz = u_xlat16_3.xyz * u_xlat16_4.xyz;
    u_xlat16_3.xyz = u_xlat16_3.xyz * vec3(vec3(_IndirectIntensity, _IndirectIntensity, _IndirectIntensity));
    u_xlat16_3.xyz = (u_xlatb2.x) ? u_xlat16_3.xyz : vec3(0.0, 0.0, 0.0);
    u_xlat16_3.xyz = u_xlat16_4.xyz * u_xlat16_1.xyz + u_xlat16_3.xyz;
    u_xlat16_1.xyz = u_xlat16_1.xyz * u_xlat16_4.xyz;
    SV_Target0.xyz = (u_xlatb2.x) ? u_xlat16_3.xyz : u_xlat16_1.xyz;
    return;
}

